            // Create a lookup dictionary for Gundams (case-insensitive for safety)
            var gundamMap = context.Gundams.ToList().ToDictionary(g => g.ModelNumber, g => g, StringComparer.OrdinalIgnoreCase);

            // Link Kits to Gundams
            foreach (var kit in kits)
            {
                if (kit.GundamModels != null)
                {
                    foreach (var modelNumber in kit.GundamModels)
                    {
                        if (gundamMap.TryGetValue(modelNumber, out var gundam))
                        {
                            kit.Gundams.Add(gundam);
                        }
                    }
                }
            }

            context.GunplaKits.AddRange(kits);
            context.SaveChanges();

